INSERT INTO `blogs` VALUES (1,'Mercedes modellen 1.6 T tot aan AMG nu via OBD !','Vanaf vandaag kunnen wij vrijwel alle nieuwste generatie Mercedes modellen tunen via OBD. Waar voorheen de ECU gedemonteerd moest worden, een tijdrovende klus met extra kosten, kan dit nu snel via OBD. Met name de populaire 1.6 T benzine motoren uit de A en C klasse kunnen hier van profiteren. Maar ook de AMG modellen kunnen nu snel afgehandeld worden. Deze methode is van toepassing op auto’s met een Bosch computer type Bosch MED17.7.1, MED17.7.2, MED17.7.3, MED17.7.5 and MED17.7.3.1 ECUs . Wilt u de mogelijkheden voor uw auto weten , neem dan snel contact met ons op.','2019-05-13 19:00:00','2019-05-13 19:00:00'),(2,'Lancering van nieuwe website chiptuning Rotterdam','Vanaf vandaag is de eerste versie van onze nieuwe website online. De vorige was weer een paar jaar oud en noodzakelijk aan modernisering toe. Komende weken zullen er op regelmatige basis pagina’s toegevoegd worden. Op dit moment zijn we nog druk bezig om de autodatabase te updaten zodat u straks een volledig beeld heeft van de mogelijkheden voor uw voertuig.','2019-05-28 19:00:00','2019-05-28 19:00:00'),(3,'BMW G en F serie benzine motoren nu allemaal via OBD !','Vanaf vandaag is de eerste versie van onze nieuwe website online. De vorige was weer een paar jaar oud en noodzakelijk aan modernisering toe. Komende weken zullen er op regelmatige basis pagina’s toegevoegd worden. Op dit moment zijn we nog druk bezig om de autodatabase te updaten zodat u straks een volledig beeld heeft van de mogelijkheden voor uw voertuig.','2019-04-30 19:00:00','2019-04-30 19:00:00');
