aag mijn Toyota Aygo uit 2007 willen laten chiptunen. Het is een handgeschakelde 1.0 benzine motor met 68 pk. \r\nIk begrijp dat er ongeveer 12 pk bij kan komen. Dat is geen \'wauw-factor\' uiteraard, maar hij zal dan een stuk fijner invoegen op de snelweg. \r\n\r\nZou u mij de prijs kunnen mailen via malcolm.manley@live.nl . Ik zou hem graag in kort termijn langs willen brengen. \r\nIk hoor graag van u! \r\n\r\nGroet,\r\nMalcolm Manley',19,74,157,829,'2020-09-19 23:08:23','2020-09-19 23:08:23'),(357,'Oemar Khealiram','J822gg','oemar.khealiram@gmail.com','0646325100','Het gaat om stage 2 \r\nSpruitstuk decat reeds in bezit.',19,72,153,822,'2020-09-20 23:05:21','2020-09-20 23:05:21'),(358,'theo straetemans','pp294g','d.straetemans@upcmail.nl','0648521518','hallo wat kost stage 1 tuning voor mijn bmw 520 g30 nu 184 pk\r\ngroet theo straetemans',5,636,1172,5144,'2020-09-21 07:48:47','2020-09-21 07:48:47'),(359,'Raymond van Wouwe','68-PG-XH','raymond_van_wouwe@hotmail.com','0615186565','Beste,\r\n\r\nGraag wil ik informatie over de mogelijkheden van het tunen van het motormanagement, van mijn Nissan 350Z uit 2004.\r\n\r\nDe auto zou origineel 287 PK motor vermogen moeten draaien, maar ik heb de volgende aanpassingen gedaan:\r\n•	Lucht inlaat plenum vergroot\r\n•	Lucht inlaat vervangen voor K&N Typhoon open luchtfilter\r\n•	Uitlaat vervangen voor ‘true dual catback exhaust’ van Injen\r\n•	Katalysatoren vervangen voor ‘High Flow’ katalysatoren van Berk Technology\r\n•	Originele koppeling vervangen voor Exedy race koppeling Stage 1\r\n•	Origineel vliegwiel vervagen voor light wheigt flywheel\r\n\r\nAl met al zou de motor nu meer lucht moeten aanzuigen dan origineel, minder weerstand krijgen van het vliegwiel, en de uitlaatgassen zouden het systeem sneller en vrijer moeten verlaten. Opties die, als ik de informatie op de vele forums moet geloven, bij elkaar tussen de 30 en 50 PK meer moeten geven dan het standaard vermogen.\r\n\r\nEchter lees ik ook (en gevoelsmatig ervaar ik dit ook), dat zolang het motor management niet is aangepast op al deze upgrades, het vermogen nu juist MINDER dan standaard is. Inschattingen varieerden van 20 tot 60 PK minder dan standaard. \r\n\r\nVandaar dat ik opzoek ben naar een partij die het motormanagement echt kan tunen, afstellen, op alle upgrades die ik er nu op heb zitten om deze maximaal te benutten. Uiteraard met een dyno test vooraf en achteraf. Daarnaast ook graag het verwijderen van de snelheidsbegrenzer, en misschien wat pops en bangs uit de uitlaat laten komen.\r\n\r\nKunnen jullie mij hier mee helpen, hebben jullie hier de kennis voor in huis, en zo ja wat mag dit kosten?\r\n\r\nIk hoor het graag, alvast bedankt.\r\n\r\nMvg,\r\n\r\nRaymond',33,255,483,2404,'2020-09-21 09:55:38','2020-09-21 09:55:38'),(360,'Chris van Vugt','72xvd7','c.vugt7@chello.nl','0611107138','graag info en prijsopgave chiptuning mercedes w204 200cdi bj 2011',67,303,588,3031,'2020-09-21 16:34:40','2020-09-21 16:34:40'),(361,'Karabek','84RZG7','karabekg@live.nl','0681959406','Beste,\r\nIk heb een Audi A7 2.8 FSI (atmosferische motor zonder turbo). Heeft het zin om deze te chip tunen, wat zijn zowel de voor- en nadelen? Hoeveel vermogen zou u hier extra uit kunnen halen?\r\n\r\nvr. gr.\r\nGökhan Karabek',NULL,NULL,NULL,NULL,'2020-09-22 08:56:38','2020-09-22 08:56:38'),(362,'ddddd','ddddd','ddddd','ddddd','ddddd',3,684,1283,5790,'2020-09-22 09:16:53','2020-09-22 09:16:53'),(363,'Bernardo','31xln5','bernardoscholten@hotmail.com','0640133319','Graag de prijzen van stage 1 en stage 2.\r\n\r\nBedankt',3,700,1297,5927,'2020-09-22 22:12:23','2020-09-22 22:12:23'),(364,'Eric','3-KBV-59','anmaer98@gmail.com','0653621528','Goedemorgen,\r\n\r\nWat zijn de kosten om mijn Mini paceman cooper S 184 pk te tunen?\r\n\r\nMvg,\r\n\r\nEric',30,269,502,2468,'2020-09-24 07:57:21','2020-09-24 07:57:21'),(365,'ffff','fffff','fffff','ffffff','ffffff',11,32,70,319,'2020-09-24 10:12:12','2020-09-24 10:12:12'),(366,'ddd','dddd','dddd','ddddd','dddd',