INSERT INTO `posts` VALUES (1,'Lancering van nieuwe website chiptuning Rotterdam','<figure class=\"image\"><img src=\"http://admin.chiptuningrotterdam.nl/userfiles/files/lancering-chiptuning-1080x675(1).png\"></figure><p><br>Vanaf vandaag is de eerste versie van onze nieuwe website online. De vorige was weer een paar jaar oud en noodzakelijk aan modernisering toe. Komende weken zullen er op regelmatige basis pagina’s toegevoegd worden. Op dit moment zijn we nog druk bezig om de autodatabase te updaten zodat u straks een volledig beeld heeft van de mogelijkheden voor uw voertuig.</p>','2019-05-29 15:31:09','2020-01-26 16:31:09'),(2,'Mercedes modellen 1.6 T tot aan AMG nu via OBD !','<figure class=\"image\"><img src=\"http://admin.chiptuningrotterdam.nl/userfiles/files/mercedes-chiptuning-1080x675.jpg\"></figure><p><br>Vanaf vandaag kunnen wij vrijwel alle nieuwste generatie Mercedes modellen tunen via OBD. Waar voorheen de ECU gedemonteerd moest worden, een tijdrovende klus met extra kosten, kan dit nu snel via OBD. Met name de populaire 1.6 T benzine motoren uit de A en C klasse kunnen hier van profiteren. Maar ook de AMG modellen kunnen nu snel afgehandeld worden. Deze methode is van toepassing op auto’s met een Bosch computer type Bosch MED17.7.1, MED17.7.2, MED17.7.3, MED17.7.5 and MED17.7.3.1 ECUs . Wilt u de mogelijkheden voor uw auto weten , neem dan snel contact met ons op.</p>','2019-05-14 15:31:50','2020-01-26 16:31:50'),(3,'BMW G en F serie benzine motoren nu allemaal via OBD !','<figure class=\"image\"><img src=\"http://admin.chiptuningrotterdam.nl/userfiles/files/bmw-chiptuning-via-obd-1080x675.jpg\"></figure><p><br>Vanaf vandaag is de eerste versie van onze nieuwe website online. De vorige was weer een paar jaar oud en noodzakelijk aan modernisering toe. Komende weken zullen er op regelmatige basis pagina’s toegevoegd worden. Op dit moment zijn we nog druk bezig om de autodatabase te updaten zodat u straks een volledig beeld heeft van de mogelijkheden voor uw voertuig.</p>','2019-05-01 15:32:39','2020-01-26 16:32:39'),(4,'Update website met nieuwe auto database 2020','<figure class=\"image\"><img src=\"http://admin.chiptuningrotterdam.nl/userfiles/files/sdfsdf.png\"></figure><p><br>&nbsp;</p><p>Op 24 januari 2020 is onze vernieuwde website met uitgebreide auto database gelanceerd. Wij hebben op de achtergrond veel werk verzet om u een zo uitgebreid mogelijke auto / motor database aan te kunnen bieden. Hier kunt u vanaf vandaag voor elke auto merk en model de juiste waardes voor tuning Stage 1 terugvinden. Voor bepaalde auto\'s is tevens een Stage 2 chiptuning mogelijk. Als chiptuning bedrijf is het voor ons ook van belang dat de website altijd snel is. Hier hebben wij veel aandacht aan besteed. Op dit moment zijn we druk bezig om de mobiele website te optimaliseren.</p><p>De komende tijd zullen wij de website uitbreiden met meer informatie over chiptuning, dsg tuning en een veel gestelde vragen sectie.&nbsp;</p>','2020-01-26 20:17:48','2020-01-27 07:11:24'),(5,'Nieuwe modellen nu te tunen met Bosch MD1 en MG1 ecu\'s','<figure class=\"image\"><img src=\"http://admin.chiptuningrotterdam.nl/userfiles/files/rs5%202020%20chiptuning.jpg\"><figcaption>Audi RS5 chiptuning</figcaption></figure><p>Sinds deze week hebben wij weer een hele reeks nieuwe auto\'s toegevoegd aan onze database die geoptimaliseerd kunnen worden. Zowel benzine, diesel als hybride voertuigen. Denk aan auto\'s zoals de Audi RS5, Mercedes C 300D, Audi SQ8 V8 TDI, Porsche Macan Turbo, BMW M340i G20, Peugeot 208 HDI, VW Polo GTI, Lamborghini Urus, maar ook de Porsche Cayenne Turbo S E-Hybrid, dit zijn slechts enkele van de vele modellen die worden toegevoegd aan onze voertuigenlijst,&nbsp;</p>','2020-01-28 09:25:00','2020-01-28 09:25:00');
