INSERT INTO `reviews` VALUES (1,'Qwerty Ytrewq','https://lh4.ggpht.com/-Uymzmz-BgG0/AAAAAAAAAAI/AAAAAAAAAAA/XnNh8qQY-8I/w40-h40-p-mo/photo.jpg','5','2020-01-22','Remapped ecu and teplaced egr, now car works great. They found a cheaper way to do it and it was fast! I can be on roads again!','2020-01-22 22:57:57','2020-01-22 22:57:57'),(2,'Al hisaan Heavy Industries','https://lh3.ggpht.com/-Bzx9R9hF05A/AAAAAAAAAAI/AAAAAAAAAAA/KZ4cGXimM2s/w40-h40-p-mo/photo.jpg','5','2019-07-22','Excellent service, always someone to address regarding car repair or maintenance. Very friendly and also ready to share top tips or advice on the most wallet friendly route in wanting to fix your car in regards to sourcing parts, very fair pricing and cute dog as a mascot!','2020-01-22 22:57:57','2020-01-22 22:57:57'),(3,'Removals and Storage Experts','https://lh4.ggpht.com/-Mds7JQE3Zig/AAAAAAAAAAI/AAAAAAAAAAA/ce47nAPInA4/w40-h40-p-mo/photo.jpg','5','2013-01-22','Thanks again Jacob for tuning my car, excellent work, love the way it drives now. More power and better fuel economy. I can definitely recommend it.','2020-01-22 22:57:57','2020-01-22 22:57:57'),(4,'RL M','https://lh5.ggpht.com/-DVpXvAKPNfs/AAAAAAAAAAI/AAAAAAAAAAA/1LUkDK8NI6w/w40-h40-p-mo/photo.jpg','5','2020-01-08','\nVandaag mijn ibiza 1.2 ecomotive hier laten chiptunen + egr softwarematig wegschrijven. Deze mannen zijn behulpzaam, leveren goede kwaliteit, en hebben kennis van zaken. Het verschil (75pk naar 105 pk) was tijdens de testronde in bijzijn van de medewerker al duidelijk merkbaar. Ik raad iedereen Chiptuning Rotterdam ook echt van harte aan??','2020-01-22 22:57:57','2020-01-22 22:57:57'),(5,'Ramesh Mohan','https://lh3.ggpht.com/-P2goySaKNrs/AAAAAAAAAAI/AAAAAAAAAAA/x7mhTveL6vo/w40-h40-p-mo/photo.jpg','5','2020-01-22','Zoals van tevoren besproken, is mijn auto optimaal nagekeken en daarna getuned.\n\nIk ben er zeer tevreden mee, en raad iedereen deze bedrijf aan.','2020-01-22 22:57:57','2020-01-22 22:57:57'),(6,'Mohamad Entabi','https://lh6.ggpht.com/-yItrv-bo5fc/AAAAAAAAAAI/AAAAAAAAAAA/iU8Io0Ezar4/w40-h40-p-mo/photo.jpg','4','2020-01-22','Mijn Ford Fiesta 2015 motor 1.5tdci wordt echt sneller en soepeler heb zelf  het verschil gemerkt.\nDank jullie wel heren.','2020-01-22 22:57:57','2020-01-22 22:57:57'),(7,'ucho25 .','https://lh5.ggpht.com/-hMkPnXoJGsU/AAAAAAAAAAI/AAAAAAAAAAA/jkq-IPZBSCc/w40-h40-p-mo/photo.jpg','5','2019-10-22','\nVandaag mijn Vw T5 laten 1.9 met 86 pk. Na Chiptuning 137 pk en wat een trekkracht man o man. Met 1 woord geweldig. Normaal heb ik altijd problemen met het invoegen/ oprijden van de brienenoordbrug als me bus vul zit. Na chiptuning gelijk na bouwmaat flink wat 2 en 3 balken en platen gehaald. Kort verhaal, totaal geen probleem met het oprijden van brienenoordbrug.\nMensen niet tobben maar gewoon doen.\n\nIk ben super tevreden.','2020-01-22 22:57:57','2020-01-22 22:57:57'),(8,'Paul van der Wende','https://lh5.ggpht.com/-ij9SVb0fy0c/AAAAAAAAAAI/AAAAAAAAAAA/PXAkYAcEWjI/w40-h40-p-mo/photo.jpg','5','2019-08-22','\nJacub heeft mijn Peugeot Expert 1.6 met 95pk gechiptuned naar 120pk. Het ging niet zozeer om meer pk\'s maar vooral het koppel wat voor mij belangerijk was aangezien ik regelmatig de auto zwaarbeladen heb en ook een aanhanger achter de auto trek. Jacub en Ugur hebben fantastisch werk verricht aan de auto en ik ben meer dan dik tevreden over het resultaat. Ik raad u zeer zeker aan om een bezoek te brengen aan de website en een mail te sturen voor een offerte.','2020-01-22 22:57:57','2020-01-22 22:57:57'),(9,'L.K Tsang','https://lh6.googleusercontent.com/-PUPEjGfcDbQ/AAAAAAAAAAI/AAAAAAAAAAA/mGwfYVvjnrI/w40-h40-p-rp-mo-br100/photo.jpg','5','2019-11-22','\nTop service\nVriendelijke mensen en de auto rijdt er veel beter op.','2020-01-22 22:57:57','2020-01-22 22:57:57'),(10,'Mari Schippers','https://lh3.googleusercontent.com/-xEBL1S57AYU/AAAAAAAAAAI/AAAAAAAAAAA/7JfeB8ZOMVk/w40-h40-p-rp-mo-br100/photo.jpg','5','2019-07-22','\nZeer goed geholpen en netjes gewerkt. Mijn Mercedes A180 AMG-line automaat getuned van 122 PK naar 175PK. Hij is een stuk sneller, reageert beter op het gas en rijdt veel soepeler. Verder schakelt hij beter op en af. Super tevreden met het resultaat!!','2020-01-22 22:57:57','2020-01-22 22:57:57'),(11,'aad offeren','https://lh5.googleusercontent.com/-ne_zl1pfvzo/AAAAAAAAAAI/AAAAAAAAAAA/WeYsnKxytrk/w40-h40-p-rp-mo-br100/photo.jpg','5','2019-08-22','\nFijn  geholpen  polo 1.2 tdi van 75 pk naar 105\nPk en dat voel je ken nu vlot mee met verkeer top','2020-01-22 22:57:57','2020-01-22 22:57:57'),(12,'murat houden','https://lh4.googleusercontent.com/-EbQJ5kBINvQ/AAAAAAAAAAI/AAAAAAAAAAA/2YKh4MXJHSg/w40-h40-p-rp-mo-br100/photo.jpg','5','2019-08-22','\nVriendelijke mensen en de auto rijdt er veel beter op.','2020-01-22 22:57:57','2020-01-22 22:57:57'),(13,'Sjaak De Jong','https://lh6.googleusercontent.com/-w_60KwXResI/AAAAAAAAAAI/AAAAAAAAAAA/bq3T9MkladY/w40-h40-p-rp-mo-br100/photo.jpg','5','2019-06-22','\nErg tevreden over de tuning van mijn Polo, de auto was in eerste instantie vrij sloom maar nu reageert deze zeer direct op het gaspedaal. Ik stap nu elke dag met een dikke glimlach achter het stuur. Bedankt jongens !!','2020-01-22 22:57:57','2020-01-22 22:57:57'),(14,'Patrick Broers','https://lh6.googleusercontent.com/-HOMqCnyDGXk/AAAAAAAAAAI/AAAAAAAAAAA/xVQNm1Nl96c/w40-h40-p-rp-mo-br100/photo.jpg','5','2019-06-22','\nHeb mijn Polo diesel laten kietelen door de heren van ChiptuningRotterdam en wat rijdt de auto top ! Accelereert stuk sneller, ook op tussensprints, heerlijk om mee te rijden, bedankt !','2020-01-22 22:57:57','2020-01-22 22:57:57'),(15,'Ryan Mackintosh','https://lh3.googleusercontent.com/-ngtLkPElqYY/AAAAAAAAAAI/AAAAAAAAAAA/Se0fdCDfTTU/w40-h40-p-rp-mo-br100/photo.jpg','5','2019-07-22','\nTop service,top gasten,top bedrijf.....\nDikke lach op mijn gezicht toen ik in mijn auto stapte en wegreed','2020-01-22 22:57:57','2020-01-22 22:57:57'),(16,'giovanni kloosterman','https://lh6.googleusercontent.com/-S3DS2CPv57s/AAAAAAAAAAI/AAAAAAAAAAA/3wUok-NWFmg/w40-h40-p-rp-mo-br100/photo.jpg','5','2019-07-22','\nIk heb vandaag mijn bmw e60 535d stage 2 laten chippen ik ben er hier heel te vrede over en klant vriendelijkheid is een 10','2020-01-22 22:57:57','2020-01-22 22:57:57'),(17,'King Cobrs','https://lh5.googleusercontent.com/-fnUnaO4kwks/AAAAAAAAAAI/AAAAAAAAAAA/MNcaPTDig94/w40-h40-p-rp-mo-br100/photo.jpg','5','2020-01-22','\nIk heb me porsche cayenne 3.0 tdi gechipt van 240 naar 300 eerst vond ik het niet echt een porsche gevoel beetje zwaar leekt die wel maar nu geen ene probleem net als een vliegtuig letterlijk ik raad iedereen hier aan en klantvriendelijk heid is echt nummer 10','2020-01-22 22:57:57','2020-01-22 22:57:57'),(18,'rob rietstra','https://lh6.googleusercontent.com/-GeId_zLWMYI/AAAAAAAAAAI/AAAAAAAAAAA/RFf5-q_5jyA/w40-h40-p-rp-mo-br100/photo.jpg','5','2020-01-22','\nvandaag mijn audi a1 laten chippen\nje merkt gelijk verschil  ook kwa pk van 86 naar 130\nben heel tevreden duurt ook niet lang','2020-01-22 22:57:57','2020-01-22 22:57:57'),(19,'Hans Otjes','https://lh6.googleusercontent.com/-kxbXBBm7JbI/AAAAAAAAAAI/AAAAAAAAAAA/27Q89yy2Hzg/w40-h40-p-rp-mo-br100/photo.jpg','5','2020-01-22','\nBMW 518d software optimalisatie laten doen bij Chiptuning Rotterdam.\nErg tevreden, enorme verbetering\n\nAanrader','2020-01-22 22:57:57','2020-01-22 22:57:57'),(20,'Stan Verberkt','https://lh6.googleusercontent.com/-vbDlhYmU90c/AAAAAAAAAAI/AAAAAAAAAAA/YHPPhaXC9rk/w40-h40-p-rp-mo-br100/photo.jpg','5','2017-01-22','\nOnze Tucson 2.0 CRDI automaat uit 2005 had met zijn 113 PK net te weinig vermogen. Met name bij op - en afritten en hellingen schakelde hij te snel terug om hoog in de toeren te klimmen. Na de tuning door Jakub heeft de auto veel meer vermogen, rijdt hij veel soepeler en pakt beter op bij het opschakelen door de automaat. Over afgenomen verbruik kan ik (nog) niets schrijven. Eindconclusie: de kleine investering in het tunen van de chip is zijn geld meer dan waard.','2020-01-22 22:57:57','2020-01-22 22:57:57'),(21,'Robert Golverdingen','https://lh4.googleusercontent.com/--CE3GqHNVhc/AAAAAAAAAAI/AAAAAAAAAAA/1t1ror042-g/w40-h40-p-rp-mo-br100/photo.jpg','5','2016-01-22','\nGisteren mijn Ford Mondeo Wagon 2.2 TDCI naar Jakub gebracht. Auto reed al super met 200 pk en 420Nm trekkracht, maar soms komt het kind in je boven en wil je net even dat stukje extra. Nou, dat heeft Jakub de auto gegeven. Altjd moeilijk om te controleren waar de waarden op uitgekomen zijn, maar volgens de gegevens heeft de auto 237 pk en een trekkracht van 485Nm gekregen. En dat is te merken.....ook in de lage toeren gaat de auto er als een speer vandoor, zonder dat het ongemakkelijk en/of schokkerig aanvoelt. Auto rijdt heerlijk soepel en heeft in iedere versnelling continu de power om door te gaan. Kijk er naar uit om straks heerlijk op weg naar mijn ski-oord door Duitsland te knallen. Jakub, bedankt voor de vriendelijke ontvangst en de heerlijke chiptuning/afstelling van mijn auto! Groeten van een hele gelukkige Robert Golverdingen','2020-01-22 22:57:57','2020-01-22 22:57:57'),(22,'yosoff','https://lh5.googleusercontent.com/-5433DVAuLX0/AAAAAAAAAAI/AAAAAAAAAAA/OYnNBdwSXYQ/w40-h40-p-rp-mo-br100/photo.jpg','5','2017-01-22','\n\nDe tuning bij mij heeft drie uur geduurd, ik kon gelukkig naar Nederland 1, 2 of 3 kijken en of op mijn telefoon dingen doen. Dus zorg ervoor dat je het ruim inplant en jezelf moet zien te vermaken!\nDe koffie kon beter, maar ik ben niet voor de koffie of tv daar naar toe gegaan.\nIk ben gegaan voor de tuning en dat is gebleken ook. Mijn BMW heeft van 136pk naar 220PK opgevoerd. Wat een geweldige auto is het nu, totaal anders wat daarvoor was!\nJacob weet wat hij doet en met behulp van Proline Engering is het een mooie resultaat geworden.\nKwaliteit / prijs het beste wat je kan vinden omgeving Rotterdam / Dordrecht.','2020-01-22 22:57:57','2020-01-22 22:57:57'),(23,'Roel Spijker','https://lh6.googleusercontent.com/-ZqgV-04psHg/AAAAAAAAAAI/AAAAAAAAAAA/1jEJz-RQpoM/w40-h40-p-rp-mo-br100/photo.jpg','5','2016-01-22','\nvia via gehoord van Chiptuning Rotterdam en een afspraak gemaakt via de mail waarna ik enkele dagen later met mijn Renault Trafic 1.9 diesel terecht kon voor de tuning.\nDe motor ging van 80 pk naar 127 pk en wat een verschil, nu kon ik met zware lading normaal inhalen en nu na een jaar verbruikt de motor 4% minder brandstof dus de tuning verdiend zichzelf terug.\nEen echte aanrader voor iedereen om uit laten voeren door Chiptuning Rotterdam.','2020-01-22 22:57:57','2020-01-22 22:57:57'),(24,'Michel Risseeuw','https://lh4.googleusercontent.com/-B588eiMOB2g/AAAAAAAAAAI/AAAAAAAAAAA/80vfgZ5-KuI/w40-h40-p-rp-mo-br100/photo.jpg','5','2015-01-22','\nNadat ik mijn Peugeot 407 SW 2.0 HDiF door Jacub onder handen had laten nemen (zie eerdere recensie) besloot ik om de Seat Arosa 1.4 uit 2001 van mijn vriendin ook door Jacub te laten optimaliseren.\n\nOok nu waren we niet op zoek naar meer topvermogen of een hogere topsnelheid omdat dit totaal oninteressant is (voor ons), wel waren we op zoek naar meer souplesse en en wat snellere gasrespons. De originele 60 PK is uiteraard niet wereldschokkend en zeker niet uit een 1400 cc blok. Omdat het een 8-klepper is heeft de motor relatief veel trekkracht tot 3500 rpm en daarboven bouwt hij duidelijk af. De mogelijkheden zijn bij deze motor zonder turbo eigenlijk beperkt en toch....... is het Jacub gelukt om de auto naar onze wensen aan te passen. De oorspronkelijke trage/stroperige gasreactie is nu vinnig en direct en de auto pakt krachtiger op.\nDoor de ontsteking wat vroeger te zetten (zo heb ik het begrepen) heeft de motor een totaal ander karakter gekregen waardoor de auto leuker en uitdagender rijdt. Kortom.... alweer erg tevreden. Jacub weet wat hij doet en doet wat hij weet!','2020-01-22 22:57:57','2020-01-22 22:57:57'),(25,'Patrick Gabry','https://lh5.googleusercontent.com/-mz-aV7VH4Rk/AAAAAAAAAAI/AAAAAAAAAAA/h7tr81Zv_Xs/w40-h40-p-rp-mo-br100/photo.jpg','4','2015-01-22','\nCitroën C3 1.6 hdi hier onlangs laten tunen. De ingebouwde beveiliging sputterde flink tegen waardoor het tunen wat langer duurde dan gehoopt. De koffie smaakte er niet minder om en het was prettig dat de afspraak in de avonduren gepland kon worden.\nDe rij-ervaring na tuning is positief, de motor pakt makkelijker op en de auto is een stuk vlotter geworden. Met gemak een aanhanger over de bergen gesleurd onderweg naar onze vakantiebestemming. Al met al een positieve ervaring met ChiptuningRotterdam, probeer het gerust zelf :)','2020-01-22 22:57:57','2020-01-22 22:57:57'),(26,'Marjan Groenendijk','https://lh3.googleusercontent.com/-K2yRVT9fA3g/AAAAAAAAAAI/AAAAAAAAAAA/MXLDMaZXXN4/w40-h40-p-rp-mo-br100/photo.jpg','4','2015-01-22','\nGeachte,\nReeds bij het starten van de motor na het tunen hoorde ik het verschil. Eerst was het een soort knikkerbak en na het tunen loopt de motor veel soepeler. Ook tijdens het rijden merk ik veel verschil. De trekkracht is duidelijk beter en ik hoef dus niet terug te schakelen als ik bv. uit een tunnel kom. Ook het opschakelen kan sneller. Over het brandstofverbruik heb ik nog geen mening omdat het tunen daarvoor te kort geleden is.\nA. Groenendijk\nFiat Ducato Camper 130 Multijet.','2020-01-22 22:57:57','2020-01-22 22:57:57'),(27,'Vincent De Laat','https://lh6.googleusercontent.com/-69Wz_h3cFYg/AAAAAAAAAAI/AAAAAAAAAAA/wmJGW2bGIU8/w40-h40-p-rp-mo-br100/photo.jpg','5','2018-01-22','\nMijn honda civic diesel laten chippen bij Rotterdam chip tuning..\nGoeie service en merkbaar meer vermogen.\nHet jaar erop de roetfilter laten verwijderen.\nOok toen ik problemen met een storing prima geholpen.Al met al zeker aanraadbaar.\ntop!','2020-01-22 22:57:57','2020-01-22 22:57:57'),(28,'Jan-Wiebren de Reus','https://lh5.googleusercontent.com/-ghXajiENZjQ/AAAAAAAAAAI/AAAAAAAAAAA/0OUyJ1P8P8g/w40-h40-p-rp-mo-br100/photo.jpg','5','2016-01-22','\n15 juli 20015 heb ik mn Alfa Mito 1.4 Turbo benzine multijet motor laten chiptunen bij\nChiptuning Rotterdam. Wat Jakub presteert is super goed. De alfa is niet de gemakkelijkste om te chippen, maar het resultaat is 100%. Van 135 PK met 205 Nm koppel naar 167 PK met 300Nm koppel!! En de souplesse en trekkracht is super.\nAanrader!!','2020-01-22 22:57:57','2020-01-22 22:57:57'),(29,'Marco Prins','https://lh3.googleusercontent.com/-zteltvNp3M0/AAAAAAAAAAI/AAAAAAAAAAA/UDav0NSoDI8/w40-h40-p-rp-mo-br100/photo.jpg','5','2014-01-22','\nOp mijn peugeot 508SW 1.6THP (lease maar ik zie het als mijn eigen auto) een tune laten uitvoeren bij Chiptuning Rotterdam met als doel wat vlotter rijgedrag en een wat lager verbruik om de kleine investering minimaal terug te verdienen. En dat is gelukt de auto is zelfs vlotter, vooral op de snelweg, dan voorheen. Ook de service van Jacob is top!\n\nGroet,\n\nMarco P.\nREXEN','2020-01-22 22:57:57','2020-01-22 22:57:57'),(30,'Willem Dejong','https://lh6.googleusercontent.com/-2WQi-IJHNmw/AAAAAAAAAAI/AAAAAAAAAAA/asWjRKcEJb8/w40-h40-p-rp-mo-br100/photo.jpg','5','2017-01-22','\nGeweldig? Super! Jakub van Chiptuning geeft duidelijke informatie en neemt de tijd voor zijn werk. Het resultaat? Een tevreden klant erbij en een auto die weer smooth èn pittig rijdt. Mijn zescilinder reed al goed maar nu: een openbaring aan rijgenot!?','2020-01-22 22:57:57','2020-01-22 22:57:57'),(31,'Tohid Navabi','https://lh3.googleusercontent.com/-uqinYztYAXE/AAAAAAAAAAI/AAAAAAAAAAA/5mHfZYuc2lg/w40-h40-p-rp-mo-br100/photo.jpg','5','2015-01-22','\nIk heb afgelopen week mij Renault Megane (1.5 dCi-motor) bij Jakub laten tunen. Het verschil is daarna gelijk merkbaar. De auto loopt veel soepeler en is zuiniger. Aangezien ik veel KM\'s maak, ga ik deze kleine investering (Jakub is ivm de concurrentie voordeliger) snel terug verdienen. De service was buitengewoon goed en ik kan niets anders zeggen dan dat ik erg tevreden ben. Een aanrader dus!','2020-01-22 22:57:57','2020-01-22 22:57:57'),(32,'Dejavu Cars','https://lh5.googleusercontent.com/-3a-n140_Gcc/AAAAAAAAAAI/AAAAAAAAAAA/bJn_58__Zpg/w40-h40-p-rp-mo-br100/photo.jpg','5','2018-01-22','\nOnze bedrijfswagen VW T5 GP van 84 PK naar 175 PK gechipt. Zeer tevreden. Zeker een aanrader.','2020-01-22 22:57:57','2020-01-22 22:57:57'),(33,'Jeffrey de Graaf','https://lh5.googleusercontent.com/-H4GXHVFUNEE/AAAAAAAAAAI/AAAAAAAAAAA/pwl2GuGXFWM/w40-h40-p-rp-mo-br100/photo.jpg','5','2017-01-22','\nIk ben heel vriendelijk ontvangen. Na ongeveer 1,5 uur was de auto klaar. Het verschil is goed te merken. De auto trekt duidelijk soepeler op. Verschil in verbruik zal de tijd nog uit moeten wijzen. Top Jakub, Bedankt!','2020-01-22 22:57:57','2020-01-22 22:57:57'),(34,'Ewa Konieczna','https://lh4.googleusercontent.com/-b713OBLSOjU/AAAAAAAAAAI/AAAAAAAAAAA/qTfBzr_AQI0/w40-h40-p-rp-mo-br100/photo.jpg','5','2015-01-22','\nMijn VW Polo 1.2 TDI blue motion was wat aan de trage kant. Na een kort gesprek waarin alles werd uitgelegd werd de auto gechipt. Hierna heb ik een proefritje gemaakt en de auto reed stukken lekkerder. Vooral bij het optrekken heeft de auto nu meer pit. Ik wil niet meer terug naar de oude Polo :)','2020-01-22 22:57:57','2020-01-22 22:57:57'),(35,'jan engel','https://lh3.googleusercontent.com/-ns97iXUT6qo/AAAAAAAAAAI/AAAAAAAAAAA/5BYoB4iJiY8/w40-h40-p-rp-mo-br100/photo.jpg','4','2017-01-22','\nAl na de eerste kilometer was het verschil goed merkbaar. Ik was aanvankelijk sceptisch over chiptuning, maar ik ben bekeerd. Het verschil in verbruik zal op termijn blijken maar, de acceleratie is zo veel soepeler en vlotter!  Bedankt Jakub','2020-01-22 22:57:57','2020-01-22 22:57:57'),(36,'Shager Pohi','https://lh3.googleusercontent.com/-c6xn8X8rrSA/AAAAAAAAAAI/AAAAAAAAAAA/kMUIcdmO9C8/w40-h40-p-rp-mo-br100/photo.jpg','5','2018-01-22','\nWOW! Gewoon super. Rotterdam Chiptuning is zeker een aanrader. Had niet verwacht dat het verschil zo merkbaar is. Nogmaals bedankt, TOP!','2020-01-22 22:57:57','2020-01-22 22:57:57'),(37,'Krisjan Slagboom','https://lh3.googleusercontent.com/-McOquWPIUo4/AAAAAAAAAAI/AAAAAAAAAAA/E2L_k5tVJJI/w40-h40-p-rp-mo-br100/photo.jpg','5','2014-01-22','\nHey Jacub,\nHeel erg bedankt nogmaals voor het werken aan mijn bmw...\nben er weer helemaal blij mee.\nHet is een heel andere auto geworden.... en nog zuinig ook.\nGroeten, Krisjan Slagboom','2020-01-22 22:57:57','2020-01-22 22:57:57'),(38,'Peter Dekker','https://lh5.googleusercontent.com/-0ktrnHbzXFE/AAAAAAAAAAI/AAAAAAAAAAA/Y8_MZrV56Rg/w40-h40-p-rp-mo-br100/photo.jpg','5','2014-01-22','\nOndanks dat ik al zeer tevreden was over het zuinig gebruik van mijn VW Golf 1.9 TDI wist ik dat het nog beter kon. Na een afspraak bij Chiptuning Rotterdam leerde ik dat ik inderdaad nog zuiniger kon gaan rijden en meer power kon halen uit mijn auto. Bedankt, team van Chiptuning Rotterdam','2020-01-22 22:57:57','2020-01-22 22:57:57'),(39,'Kevin Kannegieter','https://lh6.googleusercontent.com/-xYo0CZwf6uE/AAAAAAAAAAI/AAAAAAAAAAA/4rTnKeWG7c4/w40-h40-p-rp-mo-br100/photo.jpg','5','2014-01-22','\nNa een belletje kon ik nog dezelfde dag terrecht. Tuning van mijn Audi was binnen 1,5 uur gebeurt. Auto was een beetje afgeknepen maar rijdt nu super ! Prima service, ben zeer tevreden.','2020-01-22 22:57:57','2020-01-22 22:57:57'),(40,'Petra van den Bergh','https://lh3.googleusercontent.com/-uquDqhg_h7w/AAAAAAAAAAI/AAAAAAAAAAA/RvgHRjet8hs/w40-h40-p-rp-mo-br100/photo.jpg','5','2017-01-22','\nPlaatsen van een Plug &amp; Drive unit in een Mercedes GLA.\nDuidelijk wat er wel en niet mogelijk is. Keurige afspraken en snelle reactie.\n\nTop bedrijf','2020-01-22 22:57:57','2020-01-22 22:57:57'),(41,'Max De Winter','https://lh4.googleusercontent.com/-M65Gr4M4-aA/AAAAAAAAAAI/AAAAAAAAAAA/eyClGWZYjV8/w40-h40-p-rp-mo-br100/photo.jpg','1','2017-01-22','\nOpeningstijden kloppen niet. Gebeld en geen antwoord.','2020-01-22 22:57:57','2020-01-22 22:57:57'),(42,'Dris Salad','https://lh6.googleusercontent.com/-CwLDlCOVuHA/AAAAAAAAAAI/AAAAAAAAAAA/HYB_UKUHRqA/w40-h40-p-rp-mo-br100/photo.jpg','5','2015-01-22','\nVan 105 pk naar 150 pk even bellen en kon direct terecht super!!!\nJacob ik ben je dankbaar je bent een echte aanrader.\nTop Service!!','2020-01-22 22:57:57','2020-01-22 22:57:57'),(43,'Marjolein Verbeek','https://lh3.googleusercontent.com/-eVmQpSEYzA8/AAAAAAAAAAI/AAAAAAAAAAA/5gh5pnSS-4w/w40-h40-p-rp-mo-br100/photo.jpg','5','2013-01-22','\nErg tevreden met het chippen van mijn VW Polo, is een stuk vlotter geworden bij het optrekken. Aardige jongens bij chiptuning Rotterdam, aanrader !','2020-01-22 22:57:57','2020-01-22 22:57:57'),(44,'Eddie K.','https://lh5.googleusercontent.com/-P2vmCmyhrH4/AAAAAAAAAAI/AAAAAAAAAAA/O9IiCcmkjRQ/w40-h40-p-rp-mo-br100/photo.jpg','5','2014-01-22','\nZeer positief verrast.:\nNa lang twijfelen toch maar een afspraak gemaakt bij Chiptuning Rotterdam om mijn Audi TT 2.0TFSI DSG 200pk iets te kietelen. Omdat ik maar weinig recensies kon vinden heb ik eerst even gebeld en kreeg ik contact met Jacob de eigenaar. Ik werd zeer prettig te woord gestaan en snelle verkoop praatjes werden mij bespaard wat ik zeer fijn vind, want je wil toch een vertrouwd gevoel hebben.\nOok op de dag van installatie (locatie is in Zwijndrecht)  werd ik zeer vriendelijk ontvangen en onder het genot van een kopje koffie begon Jacob aan de installatie.\nDe originele software van de auto werd uitgelezen via de OBD stekker en opgeslagen, daarna werd de nieuwe software geladen. In totaal duurde dit wel een aantal uur, want het was een vrij zwaar bestand.\nJakob is een voorstander van verantwoorde tuning legde hij mij uit, ze streven ernaar om de vermogensafgifte zo mooi mogelijk te laten verlopen en de nieuwe waarden binnen de veilige marge te houden. Uiteraard was dit geen probleem voor mij want ik wil mijn liefje graag heel houden ;0 Goed na afloop samen een stukje proefgereden en het toegenomen koppel was duidelijk merkbaar. Omdat mijn motor nog koud was heb ik het testrijden in de dagen erna voortgezet. Er zijn veel discussies dat de ECU zich moet in-leren maar het is echt waar heb ik ervaren. De tuning was direct merkbaar maar werd in de dagen erna steeds beter. Hoeveel PK en Koppel erbij is gekomen weet ik niet maar de TT rijdt super en gaat er als raket vandoor als je daarom vraagt. Al enige tijd werd ik getreiterd door een opgevoerde Volvo V40 R van een bekende Tuner, maar die kan ik eindelijk de achterlichten van mijn TT laten zien, en zo heb ik nog een aantal mensen verrast waaronder een Golf 7 GTI die het keer op keer moest afleggen en tot een klein stipje  in binnenspiegel verdween zodra we een sprint trokken vanaf 80km per uur. Het is natuurlijk altijd leuk om een wedstrijdje te winnen maar waar het mij vooral om gaat is dat de auto heerlijk rijdt en dat is gelukt. (Tip! als je auto is getuned is merk je echt verschil als je Euro 98 tankt, nog meer power! het is niet noodzakelijk maar wel lekker als je nog wat extra\'s wilt)\nIn de weken erna ben ik nog een keer terug geweest om de gas-repons iets scherper te zetten, helaas had dat niet het gewenste effect i.v.m. de DSG bak en heeft Jacob de eerste setting weer terug gezet. Deze service was kosteloos ... Geweldig Jacob!\nKortom ik rij nu in een heerlijk getunde Audi TT en had dit veel eerder moeten laten doen, en kan Chiptuning Rotterdam zeker aanbevelen gezien ik ook ervaring heb met andere tuningsbedrijfen.\nChiptuning Rotterdam/Zwijndrecht is niet groot, maar de service en prijskwaliteit verhouding is fantastisch.\nBedankt Jacob ik zal je in de toekomst zeker weer opzoeken en hoop anderen te hebben geholpen met deze review.\n\nGr. Ed','2020-01-22 22:57:57','2020-01-22 22:57:57'),(45,'EMRE OZEN','https://lh6.googleusercontent.com/-rwxhRoUry0E/AAAAAAAAAAI/AAAAAAAAAAA/U_tBHsowdDI/w40-h40-p-rp-mo-br100/photo.jpg','5','2019-11-22','','2020-01-22 22:57:57','2020-01-22 22:57:57'),(46,'Yasin Keskin','https://lh4.googleusercontent.com/-R7y6DuH2kP8/AAAAAAAAAAI/AAAAAAAAAAA/TFQW0DwAFsU/w40-h40-p-rp-mo-br100/photo.jpg','5','2020-01-22','','2020-01-22 22:57:57','2020-01-22 22:57:57'),(47,'abdulkadir yumru','https://lh4.googleusercontent.com/-r1xsUs12hsY/AAAAAAAAAAI/AAAAAAAAAAA/ke4a_NGxeAg/w40-h40-p-rp-mo-br100/photo.jpg','5','2019-07-22','','2020-01-22 22:57:57','2020-01-22 22:57:57');
